import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  
import './App.css';

// components
import SelectionPage from './views/selectionPage/SelectionPage';
import ConfirmationPage from './views/confirmationPage/ConfirmationPage';

function App() {
  // global variables
  const [time, setTime] = useState("fe");
  const [weather, setWeather] = useState("");

  function handleChange (newValue) {
    console.log(newValue);
    setTime(newValue);
    // setWeather(newValue);
  }

  return (
    <Router>
        <Routes>
        <Route exact path="/" element={<SelectionPage time={time} setSelection={handleChange} />} />
        <Route path="/confirm" element={<ConfirmationPage />} />
        </Routes>
    </Router>
  );
}

export default App;
